    :host {
        display: block;
        position: relative;
        width: 100%;
        height: 100%;
        font-family: "Roboto", sans-serif;
        font-size: 14px;
        line-height: 1.5;
        -webkit-font-smoothing: antialiased;
        margin: 0;
        overflow: clip;
        background: #f2f2f2;
    }

    :host #myViewer {
        display: flex;
        width: 100%;
        height: 100%;
        align-items: stretch;
        z-index: 10000;
        overflow: clip;
        position: absolute;
        left: 0;
        right: 0;
        --left: 0;
        --right: 0;
        transition: all 300ms ease-in-out;
    }

    :host #myToolbar {
        font-family: 'Font Awesome 6 Free';
        min-width: 400px;
        top: 0;
        align-items: center;
        justify-content: center;
        padding: 0;
        z-index: 100000;
        pointer-events: none;
        position: absolute;
        left: 95px;
        transition: all 300ms ease-in-out;
    }

    :host #myCanvas {
        width: 100%;
        height: 100%;
        cursor: default;
        pointer-events: all;
        margin: 0;
        position: relative;
    }

    :host #myNavCubeCanvas {
        position: absolute;
        width: 200px;
        height: 200px;
        bottom: 0;
        right: 0;
        z-index: 200000;
    }

    :host #myExplorer {
        position: absolute;
        height: 100%;
        color: #fff;
        background: #03103f;
        overflow: auto;
        border-right: 2px solid #212529;
        padding: 0px;
        padding-bottom: 100px;
        padding-left: 15px;
        user-select: none;
        top: 0;
        left: -460px;
        z-index: 10;
        width: 460px;
        transition: all 300ms ease-in-out;
    }

    :host #explorer_toggle {
        display: none;
    }

    :host .explorer_toggle_label {
        position: absolute;
        top: 10px;
        left: 20px;
        -webkit-user-select: none;
        -ms-user-select: none;
        user-select: none;
        flex: 1 1 auto;
        color: #03103f;
        background-color: white;
        text-align: center;
        vertical-align: middle;
        border: 2px solid #1d2453;
        padding: 0.375rem 0.75rem;
        border-radius: 0.25rem;
        -webkit-appearance: button;
        overflow: visible;
        margin: 0 2px 0 0;
        box-sizing: border-box;
        align-items: flex-start;
        pointer-events: all;
        z-index: 100000;
        transition: all 300ms ease-in-out;
    }

    :host .explorer_toggle_label:hover {
        cursor: pointer;
    }

    :host #explorer_toggle:checked + .explorer_toggle_label {
        left: 480px;
        color: #fff;
        background-color: #03103f;
        border-color: #03103f;
    }

    :host #explorer_toggle:checked ~ #myExplorer {
        left: 0;
    }

    :host #explorer_toggle:checked ~ #myViewer {
        left: 460px;
        --left: 460;
        width: calc(100% - (var(--left) + var(--right)));
    }

    :host #explorer_toggle:checked ~ #myToolbar {
        left: 555px;
    }

    :host #explorer_toggle:not(:checked) + .explorer_toggle_label {
        left: 20px;
        color: #fff;
        background-color: #03103f;
        border-color: #03103f;
    }

    :host #explorer_toggle:not(:checked) ~ #myExplorer {
        left: -460px;
    }

    :host #explorer_toggle:not(:checked) ~ #myViewer {
        left: 0;
        --left: 0;
        width: calc(100% - var(--right));
    }

    :host #explorer_toggle:not(:checked) ~ #myToolbar {
        left: 95px;
    }

    :host #myInspector {
        position: absolute;
